// UpcomingEvents.js
import React from 'react';

const UpcomingEvents = () => {
  // Dummy data for upcoming events
  const events = [
    { id: 1, title: 'Event 1', date: '2024-04-01', location: 'Location 1' },
    { id: 2, title: 'Event 2', date: '2024-04-15', location: 'Location 2' },
    { id: 3, title: 'Event 3', date: '2024-05-01', location: 'Location 3' }
  ];

  return (
    <div>
      {events.map(event => (
        <div key={event.id}>
          <h4>{event.title}</h4>
          <p>Date: {event.date}</p>
          <p>Location: {event.location}</p>
        </div>
      ))}
    </div>
  );
}

export default UpcomingEvents;
